import React from 'react';
import {CustomizedButtom} from './style';

export default function Button({content, color, padding, borerRadius}){
    return (
        <>
            <CustomizedButtom color={color} padding={padding} borderRadius={borerRadius} className="col-lg-12 col-md-12 col-sm-12 col-xs-12">
                <span>{content}</span>
            </CustomizedButtom>
        </>
    )
}
